--4760

--FB10:
SELECT DISTINCT
	PD10.DF_SPE_ACC_ID,
	FB10.BF_SSN,
	FB10.LF_FOR_CTL_NUM,
	FB10.LC_FOR_STA,
	--VALIDATION FIELDS:
	FB10.LC_STA_FOR10,
	FB10.LC_FOR_TYP,
	FB10.LF_LST_DTS_FB10
INTO
	#FB10
FROM
	UDW..FB10_BR_FOR_REQ FB10
	INNER JOIN UDW..PD10_PRS_NME PD10
		ON FB10.BF_SSN = PD10.DF_PRS_ID
	INNER JOIN
	(
		SELECT * FROM @ACCT1 UNION ALL
		SELECT * FROM @ACCT2 UNION ALL
		SELECT * FROM @ACCT3 UNION ALL
		SELECT * FROM @ACCT4 UNION ALL
		SELECT * FROM @ACCT5 
	) ALL_ACCTS
		ON PD10.DF_SPE_ACC_ID = ALL_ACCTS.ACCT
	INNER JOIN ULS.dasforbfed.ProcessQueue PQ
		ON PQ.AccountNumber = ALL_ACCTS.ACCT
WHERE
	PQ.DisasterId IN (34,35) --COVID-19 disaster ID
	AND FB10.LC_FOR_TYP = '40' --DISASTER ADMINISTRATIVE
	AND CONVERT(DATE,FB10.LF_LST_DTS_FB10) > CONVERT(DATE,'20200325')
	AND FB10.LC_STA_FOR10 = 'A' --active flag
	--AND FB10.LC_FOR_STA = 'A' --approved
ORDER BY
	PD10.DF_SPE_ACC_ID
--;


/*  TROUBLESHOOTING BORROWERS WHO KEEP APPEARING ON REPORT AFTER AES REMOVED ORIGINAL DISASTER FORB */
--select * from udw..AY10_BR_LON_ATY where BF_SSN = '129663918'
--select * from udw..PD10_PRS_NME where DF_PRS_ID = '129663918'
--select * from udw..PD30_PRS_ADR where DF_PRS_ID = '129663918'

--select * from #FB10
--select * from udw..FB10_BR_FOR_REQ where BF_SSN = '053702012'
--select * from openquery (duster,'select * from olwhrm1.fb10_br_for_req where bf_ssn = ''129663918''')

--select * from udw..LN60_BR_FOR_APV where BF_SSN = '053702012' order by LN_SEQ, LF_FOR_CTL_NUM
--select * from openquery (duster,'select * from olwhrm1.ln60_br_for_apv where bf_ssn = ''129663918''')




--LN60 dump:
SELECT DISTINCT
	FB10.DF_SPE_ACC_ID
	,LN60.*
FROM
	#FB10 FB10
	INNER JOIN UDW..LN60_BR_FOR_APV LN60
		ON FB10.BF_SSN = LN60.BF_SSN
		AND FB10.LF_FOR_CTL_NUM = LN60.LF_FOR_CTL_NUM
ORDER BY
	FB10.DF_SPE_ACC_ID
;

--AY10:
SELECT DISTINCT
	PD10.DF_SPE_ACC_ID,
	AY10.BF_SSN,
	AY10.LN_ATY_SEQ,
	AY10.LC_STA_ACTY10,
	AY10.LF_LST_DTS_AY10,
	DIS.Disaster,
	DIS.BeginDate,
	DIS.EndDate,
	--Z.ZipCode
	pd30.DC_DOM_ST
FROM
	ULS.dasforbfed.ProcessQueue PQ
	INNER JOIN ULS..ArcAddProcessing AAP
		ON PQ.ArcAddProcessingId = AAP.ArcAddProcessingId
	INNER JOIN UDW..PD10_PRS_NME PD10
		ON PQ.AccountNumber = PD10.DF_SPE_ACC_ID
	INNER JOIN
	(
		SELECT * FROM @ACCT1 UNION ALL
		SELECT * FROM @ACCT2 UNION ALL
		SELECT * FROM @ACCT3 UNION ALL
		SELECT * FROM @ACCT4 UNION ALL
		SELECT * FROM @ACCT5 
	) ALL_ACCTS
		ON PD10.DF_SPE_ACC_ID = ALL_ACCTS.ACCT
	INNER JOIN UDW..AY10_BR_LON_ATY AY10
		ON PD10.DF_PRS_ID = AY10.BF_SSN
		AND AAP.LN_ATY_SEQ = AY10.LN_ATY_SEQ
	INNER JOIN ULS.dasforbfed.Disasters DIS
		ON PQ.DisasterId = DIS.DisasterId

	inner join #FB10 fb10
		on fb10.BF_SSN = AY10.BF_SSN

	--inner join uls.dasforbfed.Zips Z
	--	on dis.DisasterId = z.DisasterId
	left join udw..PD30_PRS_ADR pd30
		on pd10.DF_prs_ID = pd30.DF_PRS_ID
		--and z.ZipCode = pd30.DF_ZIP_CDE


WHERE
	PQ.DISASTERID IN (34,35) --COVID disaster forbs
ORDER BY
	PD10.DF_SPE_ACC_ID
;